local skill_mt = {}
skill_mt.__index = function (table,key)
    for i=1, #skill_keys do
        if skill_keys[i] == key then
            return table[i]
        end
    end
end
function getDataById(bid)
    local simple = skill["id_" .. bid]
    assert(simple, "skill not found " .. bid)
    setmetatable(simple, skill_mt)
    return simple 
end
function getDataByField(fieldName,fieldValue)
    local result = {}
    for key, val in  pairs( skill ) do
        setmetatable(val, skill_mt)
        if val[fieldName] == fieldValue then
            result[#result+1] = val
        end
    end
    return result
end
